--
-- Triggers `kinerja`
--
DELIMITER $$
CREATE TRIGGER `auto_fill_pegawai_info` AFTER INSERT ON `kinerja` FOR EACH ROW BEGIN
    DECLARE v_id_pegawai INT;
    DECLARE v_nama VARCHAR(255);
    DECLARE v_jabatan VARCHAR(255);

    -- Cari id_pegawai, nama, dan jabatan berdasarkan ciri-ciri
    SELECT p.id_pegawai, p.nama, p.jabatan
    INTO v_id_pegawai, v_nama, v_jabatan
    FROM pegawai p
    WHERE 
        NEW.tinggi = p.tinggi AND
        NEW.tubuh = p.tubuh AND
        NEW.kulit = p.kulit AND
        NEW.rambut = p.rambut AND
        NEW.wajah = p.wajah
    LIMIT 1;

    -- Update id_pegawai, nama_pegawai, dan jabatan_pegawai di tabel kinerja
    UPDATE kinerja
    SET id_pegawai = v_id_pegawai,
        nama_pegawai = v_nama,
        jabatan_pegawai = v_jabatan
    WHERE id_pengaduan = NEW.id_pengaduan;
END
$$
DELIMITER ;

